const myImage = new Image();
myImage.src = 'data:image/png;base64,';
// if image is not hosted on same server cross-origin resource sharingproblem--> convert to url base 64



// drawImage only works when image fully loaded.. so addd event listener

myImage.addEventListener('load',(e) =>{


    const canvas = document.getElementById('canvas1');
    const  ctx = canvas.getContext('2d');


    canvas.width = 740;
    canvas.height =845;
    
  

    let mouse = {
        x: undefined,
        y: undefined,
        dx: null,
        dy: null,
        t: 0,
        dt: 0,
        radius: 100
    }


    window.addEventListener('click',(e) => {
        mouse.x = e.x;
        mouse.y =e.y;
    })


    window.addEventListener("mousemove",(e) =>{
      
    
        mouse.x = e.x;
        mouse.y = e.y;
  
    
    })

    ctx.drawImage(myImage , 0 ,0 ,canvas.width , canvas.height);


    const pixels = ctx.getImageData(0,0,canvas.width , canvas.height);

    let particleArray = [];

    const numberOfParticle = 10000;


    let mappedImage = [];

    const calculateRelativeBrightness = (r,g,b) =>{
        return Math.sqrt( 
            (r*r) * 0.299 +
            (g*g) * 0.587 +
            (b*b) * 0.114 
        )/100;

        //relative brightness human eye can recognize
    }

    for(let y = 0 ; y < canvas.height ;y++){

    let row = [];
 
  
        for(let x = 0 ; x < canvas.width ; x++){
            const red = pixels.data[(y*4 * pixels.width) + (x*4)];
            const green = pixels.data[(y*4 * pixels.width) + (x*4+1)];
            const blue = pixels.data[(y*4 * pixels.width) + (x*4+2)];

            const brightness = calculateRelativeBrightness(red,green,blue);

            const cell = [
                cellBrightness = brightness,
                Math.floor(red),Math.floor(green),Math.floor(blue)
            ]
          
            row.push(cell);
        }
        mappedImage.push(row);
    }
  
 

    
    let cnt = 0;

    class Particle {
        constructor(){
            this.x = Math.random()* canvas.width;
            this.y = 0;
            this.speed = 0 ;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.color = undefined;

            this.baseX = 0;
            this.baseY = 0;

            this.density = ( Math.random()*20) +1;
            this.trigger = false;

    


        }

        update(){




            let dx = this.x - mouse.x;
            let dy = this.y - mouse.y  > 0 ? -(this.y -mouse.y): this.y - mouse.y ;
            let distance = Math.sqrt(dx*dx + dy*dy);
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;
    
            let maxDistance = mouse.radius;
            let force = (maxDistance - distance) / maxDistance;
    
            let directionX = forceDirectionX * force * this.density*maxDistance;
            let directionY = forceDirectionY * force * this.density*maxDistance;


        

            // 현 x, y좌표가 원래 지점과 같을때 트리거 false
            if(Math.floor(this.x) == Math.floor(this.baseX) && Math.floor(this.baseY) == Math.floor(this.y)){
                
                this.trigger = false;
        
            }


            //트리거 온
            if(this.trigger == false){
            
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
    
    
                this.color = 'rgb('+ mappedImage[this.position1][this.position2][1] +',' + mappedImage[this.position1][this.position2][2] + ',' +mappedImage[this.position1][this.position2][3] + ')';
                this.speed = mappedImage[this.position1][this.position2][0];
    
    
                this.baseX = this.x;
                this.baseY = this.y;
            }
         
            if(distance < mouse.radius && (this.color !== 'rgb(0,0,0,'+ctx.globalAlpha+')')){

            this.trigger =true;


               

                this.x += directionX /100;
             this.y += directionY/ 100;
       

            }else{
            
              
                if(this.trigger){
                    if(this.x !== this.baseX ){
                        let dx = this.x - this.baseX;
        
                        this.x -= dx / 10;
                    }
                    if(this.y !== this.baseY){
                        let dy = this.y - this.baseY;
        
                        this.y -= dy / 10;
                    }
                   

                }else{
                    let movement = (2.5 - this.speed) + this.velocity;


                    this.y += movement;

                    if(this.y >= canvas.height){
                        this.y = 0;
                        this.x = Math.random() * canvas.width;
                    }
                }
            }
            

        }

        draw(){
            ctx.beginPath();
            ctx.fillStyle = this.color || 'white';
            ctx.arc(this.x,this.y,this.size,0,Math.PI*2);
            
            ctx.fill();


           

        }

    }



    const init = () =>{
        for(let i = 0; i < numberOfParticle ; i++){
            particleArray.push(new Particle());
        }
    }

    init();

    const animate = () =>{


        ctx.globalAlpha = 0.05;
        // transparenty

       
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0,0,canvas.width, canvas.height);


      
        ctx.globalAlpha = 0.2;
        for(let i = 0 ; i < particleArray.length ; i++){
            particleArray[i].update();
            if(!particleArray[i].trigger){
                ctx.globalAlpha = particleArray[i].speed * 0.5 / 2;
            }
          
            particleArray[i].draw();
                }
        requestAnimationFrame(animate);

    }

    animate();

})


